package deng.easy;

import org.junit.Test;

import static org.junit.Assert.*;

/**
 * Created by deng on 2018/8/31.
 */
public class IsAnagramTest {
    @Test
    public void isAnagram() throws Exception {
        IsAnagram solution = new IsAnagram();
        assertTrue(solution.isAnagram("",
                ""));
        assertFalse(solution.isAnagram("aacc","cacc"));
        assertFalse(solution.isAnagram("rat","cat"));
    }

}